import React from "react";
import "./Dialogs.css";
import Slider from "./Slider/Slider";
import Chat from "./Chat/Chat";

const Dialog = () => {

    let messagesData = [
        {message: 'Гослинг'},
        {message: 'Вася'},
        {message: 'Путин'},
        {message: 'Трамп'},
        {message: 'Обама'},
        {message: 'Мэнсон'},
        {message: 'Антошка'}
    ]

    return (
        <div className="app-dialog">
            <Slider />
            <div className="border"></div>
            <Chat messages={messagesData} />
        </div>
    );
}

export default Dialog;
